import Store from './Store'

class App extends Component {


    render() {
        return (

            <div style={{Backgroundcolor:'black', color:'blue', position:'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0 }} >
               <div className='conatiner' >
                   <Nav/>
                   <Store/>
                   <Cards/>
                   <Footer/>

               </div>

            </div>




        );
    }
}

export default App
